package com.seven.algorithm.leetcode;

import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.Test;

class Solution1616Test {
    @Test
    void test1() {
        Assertions.assertEquals(true, Solution1616.checkPalindromeFormation("x", "y"));
    }

    @Test
    void test2() {
        Assertions.assertEquals(true, Solution1616.checkPalindromeFormation("abdef", "fecab"));
    }

    @Test
    void test3() {
        Assertions.assertEquals(true, Solution1616.checkPalindromeFormation("ulacfd", "jizalu"));
    }

    @Test
    void test4() {
        Assertions.assertEquals(false, Solution1616.checkPalindromeFormation("xbdef", "xecab"));
    }

    @Test
    void test5() {
        Assertions.assertEquals(false, Solution1616.checkPalindromeFormation("abda", "acmc"));
    }

    @Test
    void test6() {
        Assertions.assertEquals(true, Solution1616.checkPalindromeFormation(
            "",
            ""));
    }

}